  false,\n\t\"url\": null,\n\t\"notes\": \"The Missing Person Information Clearinghouse
  was established July 1, 1985, within the Department of Public Safety providing a
  program for compiling, coordinating and disseminating information in relation to
  missing persons and unidentified body/persons. Housed within the Division of Criminal
  Investigation, the clearinghouse assists in helping to locate missing persons through
  public awareness and cooperation, and in educating law enforcement officers and
  the general public about missing person issues.\",\n\t\"license_title\": \"License
